    /* Parameter adjustments */
    --iwork;
    --dwork;
    --res;
    --sol;
    jac_dim1 = *ljac;
    jac_offset = jac_dim1 + 1;
    jac -= jac_offset;

    /* Function Body */
    *ierr = 0;
